import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the modal for listing 'jun_1'
    await page.waitForSelector("[data-listing-id='jun_1']");
    await page.click("[data-listing-id='jun_1']");

    // Wait for the modal to be visible
    await page.waitForSelector('.modal-content', { visible: true });

    // Count the amenities
    const amenities = await page.$$eval('.amenity-tag', elements => elements.length);

    // Take screenshot of the modal with amenities
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_with_amenities.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_with_amenities.png'));

    return {
      success: true,
      action: "Opened jun_1 modal and counted amenities",
      extractedData: { amenitiesCount: amenities },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
